     "Version1": "Multiple design restrictions apply in this area: the main cornice line on buildings in this area may not be less than 25 feet above the sidewalk, vehicular entrances and exits are prohibited, and accessory parking lots are prohibited.  Projects in this area must be reviewed by the Planning Commission, which must judge that the project is in harmony with the Center City environment. Buildings must extend to the street line for at least 65% of the lot frontage. The following uses are prohibited: adult-oriented merchandise, drug paraphernalia, gun shops, adult-oriented service, personal credit establishments, parking, body art service, ground-floor fortune telling services; everything in the vehicle and equipment sales and services category; and everything in the wholesale, distribution, and storage category. A special exception is required for all take-out restaurants, other eating/drinking establishments if the lot is zoned commercial, basic utilities/service uses, financial services (which must be fully staffed and on the ground floor).",
